
export const defaulrImageurl = ''

export  const transferPathInfo =(pathData) =>{
  if(!pathData || pathData.length<=0){
    return null;
  }
  let num = 1;
  for (let i = 0, length = pathData.length; i < length; i++) {
    let thisPath = pathData[i];
    let serialType_ = '';
    let intervalType = thisPath.intervalType; //单元类型
    let serialType = thisPath.serialType;

    //原始数据
    if(intervalType===1 || intervalType===2 || intervalType===3)
    {
      pathData[i].classColor ='green';
    }
    //补点数据
    else
    {
      pathData[i].classColor = 'red';
    }

    if(serialType === 1)
    {
      serialType_ = "入";
      pathData[i].classColor ='blue';
    }else if(serialType === 3)
    {
      serialType_ = "出";
      pathData[i].classColor ='blue';
    }
    else
    {
      serialType_ = num;
      num++;
    }
    pathData[i].serialType_ = serialType_;
   // pathData[i].imageUrl = '';

  }

  return pathData;
}
